import dalLogo from './dalLogo.png';
import nygLogo from './nygLogo.png';
import phiLogo from './phiLogo.png';
import wasLogo from './wasLogo.png';


function dalButton() {
  window.location.replace("/dal");
}
function nygButton() {
  window.location.replace("/nyg");
}
function phiButton() {
  window.location.replace("/phi");
}
function wasButton() {
  window.location.replace("/was");
}

function NFCEast() {
  return (
    <div>
    <table id="customers">
      <tr>
        <th>EAST</th>
      </tr>
      <tr>
        <td>
          <button class="button" onClick={dalButton}>
            <img class="logos" src={dalLogo} alt="logo" width="87" height="87"/>
          </button>
        </td>
      </tr>
      <tr>
        <td>
          <button class="button" onClick={nygButton}>
            <img class="logos" src={nygLogo} alt="logo" width="87" height="87"/>
          </button>
        </td>
      </tr>
      <tr>
        <td>
          <button class="button" onClick={phiButton}>
            <img class="logos" src={phiLogo} alt="logo" width="87" height="87"/>
          </button>
        </td>
      </tr>
      <tr>
        <td>
          <button class="button" onClick={wasButton}>
            <img class="logos" src={wasLogo} alt="logo" width="87" height="87"/>
          </button>
        </td>
      </tr>
    </table>
    </div>
  );
}

export default NFCEast;
